import 'bootstrap/dist/css/bootstrap.min.css';


const GestorContent = () => {

    const dispatch = useDispatch();
    const history = useHistory();

    useEffect(() => {
      dispatch(setUserLogged());
    }, [dispatch]);

    const user = useSelector((state) => state.user)
    console.log("IDD", user)

